import menu from './Componente2';
import './App.css';
import Atanagildo from './imagenes/rey_atanagildo.png';
import Ataulfo from './imagenes/rey_ataulfo.png';
import Ervigio from './imagenes/rey_ervigio.png';
import Leogivildo from './imagenes/rey_leogivildo.png'
import Recesvinto from './imagenes/rey_recesvinto.png';
import Sisebuto from './imagenes/rey_sisebuto.png';

function App() {
  const reyes = [
    {
      nombre:"Atanagildo",
      color:"darkolivegreen",
      precio:178
    },{
      nombre:"Ervigio",
      color:"crimson",
      precio:169
    },{
      nombre:"Ataúlfo",
      color:"peru",
      precio:81
    },{
      nombre:"Leogivildo",
      color:"darkmagenta",
      precio:126
    },{
      nombre:"Recesvinto",
      color:"royalblue",
      precio:141
    },{
      nombre:"Sisebuto",
      color:"teal",
      precio:69
    }
  ]
  return (
    <>
      <h1>Total a pagar: 0€</h1>
      <menu img-rey={Atanagildo} nombre={reyes[0].nombre} color-style = {reyes[0].color} precio={reyes[0].precio}></menu>
      <menu img-rey={Ervigio} nombre={reyes[1].nombre} color-style = {reyes[1].color} precio={reyes[1].precio}></menu>
      <menu img-rey={Ataulfo} nombre={reyes[2].nombre} color-style = {reyes[2].color} precio={reyes[2].precio}></menu>
      <menu img-rey={Leogivildo} nombre={reyes[3].nombre} color-style = {reyes[3].color} precio={reyes[3].precio}></menu>
      <menu img-rey={Recesvinto} nombre={reyes[4].nombre} color-style = {reyes[4].color} precio={reyes[4].precio}></menu>
      <menu img-rey={Sisebuto} nombre={reyes[5].nombre} color-style = {reyes[5].color} precio={reyes[5].precio}></menu>
    </>
  );
}

export default App;
